American gangster Cesare Celli, hiding out in Italy, is kidnapped by Harry Price and his gang. Much to everyone's surprise, none of Cesare's friends or associates is willing to pay a ransom to get him back. Unhappy with this development, Cesare offers to assist Harry and girlfriend Juliana in pulling off a daring robbery that could net them $5 million. Cesare even brings in criminal mastermind Professor Samuels to run the operation.

